import * as actionTypes from './actionTypes'

export const login = () => ({
    type: actionTypes.LOGIN(),
    payload: {
        loggedIn: true
    }
})

export const logout = () => ({
    type: actionTypes.LOGOUT,
    payload: {
        loggedIn: false
    }
})
